import { createTheme } from '@mui/material/styles';
import purple from '@mui/material/colors/purple';
import {grey} from "@mui/material/colors";

const theme = createTheme({
    palette: {
        primary: {
            main: purple[500],
        },
        background: {
            "main": grey[500],
        },
    },
});

export default theme;
